import psycopg2

def sql(queries):
    with psycopg2.connect(host="localhost", user="postgres", password="pass", port=5432, database="postgres") as conn:
        with conn.cursor() as cursor:
            for query in queries:
                cursor.execute(query)
            conn.commit()

def get_commit_status_stmt(probe, channel, process, status):
    return f"INSERT INTO api_probebuildjob (probe_name, channel, process, status, details, timestamp) VALUES('{probe}', '{channel}', '{process}', '{status}', '', CURRENT_TIMESTAMP)"

def probe_inserts(probe, table):
    data = dummy_response(probe)

    for row in data:
        columns = ', '.join(row.keys())
        values = ', '.join(map(lambda x: f"\'{x}\'" if x else "NULL", row.values()))
        yield "INSERT INTO %s ( %s ) VALUES ( %s )" % (table, columns, values)


def build_probe(request):
    """Responds to any HTTP request.
    Args:
        request (flask.Request): HTTP request object.
    Returns:
        The response text or any set of values that can be turned into a
        Response object using
        `make_response <http://flask.pocoo.org/docs/1.0/api/#flask.Flask.make_response>`.
    """
    query = request.get_json()["query"]
    probe_name = request.get_json()["probe"]
    channel = request.get_json()["channel"]
    process = request.get_json()["process"]
    try:
        # Mark job as started as early as possible before doing any work
        sql([get_commit_status_stmt(probe_name, channel, process, "STARTED")])
        #client = bigquery.Client()
        #query_job = client.query(query)

        # Insert data and marks job as succeeded in one transaction
        row_inserts = [row_insert_stmt for row_insert_stmt in probe_inserts(probe_name, "glam_desktop_nightly_aggregation")]
        refresh_view = ["REFRESH MATERIALIZED VIEW public.view_glam_desktop_nightly_aggregation WITH DATA;"]

        #for r in row_inserts:
        #    print(r)
        commit_success  = [get_commit_status_stmt(probe_name, channel, process, "SUCCESS")]
        sql(row_inserts + refresh_view + commit_success)

        return {"response":"OK"} #dummy_response(probe_name)
    except Exception as e:
        print(e)
        sql([get_commit_status_stmt(probe_name, channel, process, "FAILED")])
        return {"response": "NOK"}
        # Mark job as failed
    #return {"execution_id": request.headers["Function-Execution-Id"]}



